const Home = () => {
  let scanStatus = "Imcomplete";

  const handleClick = () => {
    scanStatus = "Complete";
  };

  return (
    <div className="home">
      <h2>Homepage</h2>
      <p>{scanStatus}</p>
      <button onClick={handleClick}>Click Here</button>
    </div>
  );
};

export default Home;
